INSERT INTO `data_tc_ss_movie_info` VALUES (4, '19042610556001', '真假美猴王之战神归来', NULL, '', '西行万里，唐僧师徒团结一心，经过千万险，到达了白虎岭。孙悟空忠心保护唐僧，却经常被师父责骂，久而久之，心中有了怨恨。孙悟空变成了普通人回到了花果山，最后克服了怨恨战胜自我，再次踏上了取经的道路', NULL, NULL, NULL, NULL, '中国大陆', NULL, 'http://p0.meituan.net/180.250/movie/e308abd391d4512376e322a49020aa73471728.jpg', 'http://p0.meituan.net/180.250/movie/e308abd391d4512376e322a49020aa73471728.jpg', NULL, '2019-04-26 10:58:47', 0, '0', 0, '奇幻', '真假美猴王之战神归来', '', 1, '2019-04-26 10:58:47');
INSERT INTO `data_tc_ss_movie_info` VALUES (5, '19042611396001', '真假美猴王之战神归来', NULL, '', '西行万里，唐僧师徒团结一心，经过千万险，到达了白虎岭。孙悟空忠心保护唐僧，却经常被师父责骂，久而久之，心中有了怨恨。孙悟空变成了普通人回到了花果山，最后克服了怨恨战胜自我，再次踏上了取经的道路', NULL, NULL, NULL, NULL, '中国大陆', NULL, 'http://p0.meituan.net/180.250/movie/e308abd391d4512376e322a49020aa73471728.jpg', 'http://p0.meituan.net/180.250/movie/e308abd391d4512376e322a49020aa73471728.jpg', NULL, '2019-04-26 11:57:10', 0, '0', 0, '奇幻', '真假美猴王之战神归来', '', 1, '2019-04-26 11:57:10');
